int Read(){
	char ch=getchar();
	int f_r=1,r_r=0;
	while(ch<'0'||ch>'9'){
		if(ch=='-')f_r=-1;
		ch=getchar();
	}
	while(ch>='0'&&ch<='9'){
		r_r=r_r+r_r*4;
		r_r+=r_r+ch-'0';
		ch=getchar();
	}
	return f_r*r_r;
}

